const Lists = () => {
    let db=[ 
        {name:"sush",role:"QA",age:22},
        {name:"KV",role:"QC",age:21},
        {name:"Jay",role:"QM",age:20}
    ]
    return ( 
        <div className="lists">
            {db.map( (x)=>(
                <div className="persons">
                    <h1>Name:{x.name}</h1>
                    <h2>Role:{x.role}</h2>
                    <p>Age:{x.age}</p>
                </div>
            ))}
        </div>
     );
}
 
